[lock lock];

// bool success = [condition lock];
// while (!success) {
//     do nothing   
// }
bool success = [lock tryLock];
NSLock的unlock
// [condition unlock];
// [condition broadcast];
[lock unlock];
NSConditionLock
满足条件时才能获取锁。在获得锁执行保护区域代码后，可以释放锁并重新设置条件。

条件不满足，阻塞当前线程

__block int flag = 0;

NSConditionLock *lock = [[NSConditionLock alloc] initWithCondition:1];

dispatch_async(dispatch_get_global_queue(DISPATCH_QUEUE_PRIORITY_DEFAULT, 0), ^{
    // flag = 0 ; lock.condition = 1; 
    // flag != condition 无法获得锁，当前线程进入休眠,等待唤醒

    // [condition lock];
    // while (flag != condition) {
    //    [condition wait]
    // }
    [lock lockWhenCondition:flag];

    // 需要加锁保护的代码
    // lock.condition = 2;
    // [conditon unlock];
    // [condition broadcast];
    [lock unlockWithCondition:2];
});

条件不满足，阻塞，后添加满足，获得锁

__block int flag = 0;

NSConditionLock *lock = [[NSConditionLock alloc] initWithCondition:1];

dispatch_async(dispatch_get_global_queue(DISPATCH_QUEUE_PRIORITY_DEFAULT, 0), ^{
    [lock lockWhenCondition:flag];

    // 需要加锁保护的代码

    [condition unlockWithCondition:2];
});

dispatch_after(dispatch_time(DISPATCH_TIME_NOW, (int64_t)(2 * NSEC_PER_SEC)), dispatch_get_main_queue(), ^{

     // [condition unlock];
     // [condition broadcast];    
    [lock unlockWithCondition:1];
});
信号量
// 设定一个信号，当前可用为0
dispatch_semaphore_t semaphore = dispatch_semaphore_create(0);

dispatch_async(dispatch_get_global_queue(DISPATCH_QUEUE_PRIORITY_DEFAULT, 0), ^{
    NSLog(@"semaphore = 0 无法执行");
    // 如果 semaphore > 0 ,wait 会使 semaphore - 1，否则会阻塞当前线程，所以不要主线程 wait
    dispatch_semaphore_wait(semaphore, DISPATCH_TIME_FOREVER);

    NSLog(@"Run Task 1 Start");
    sleep(1);
    NSLog(@"Run Task 1 End");
    dispatch_semaphore_signal(semaphore);
});

NSLog(@"semaphore 即将+1");
// semaphore + 1
dispatch_semaphore_signal(semaphore);

dispatch_async(dispatch_get_global_queue(DISPATCH_QUEUE_PRIORITY_DEFAULT, 0), ^{
    NSLog(@"semaphore = 0 无法执行");
    // 如果 semaphore > 0 ,wait 会使 semaphore - 1，否则会阻塞当前线程，所以不要主线程 wait
    dispatch_semaphore_wait(semaphore, DISPATCH_TIME_FOREVER);

    NSLog(@"Run Task 2 Start");
    sleep(1);
    NSLog(@"Run Task 2 End");
    dispatch_semaphore_signal(semaphore);
});
上面一点代码和下面的代码执行结果没有区别
__block NSUInteger flag = 0;
NSCondition *condition = [[NSCondition alloc] init];

dispatch_async(dispatch_get_global_queue(DISPATCH_QUEUE_PRIORITY_DEFAULT, 0), ^{
    NSLog(@"semaphore = 0 无法执行");
    // 如果 semaphore > 0 ,wait 会使 semaphore - 1，否则会阻塞当前线程，所以不要主线程 wait
    while (flag == 0) {
        [condition wait];
    }
    flag--;
    NSLog(@"Run Task 1 Start");
    sleep(1);
    NSLog(@"Run Task 1 End");

    flag++;
    [condition signal];
});

NSLog(@"semaphore 即将+1");
// semaphore + 1
flag++;
[condition broadcast];

dispatch_async(dispatch_get_global_queue(DISPATCH_QUEUE_PRIORITY_DEFAULT, 0), ^{
    NSLog(@"semaphore = 0 无法执行");
    // 如果 semaphore > 0 ,wait 会使 semaphore - 1，否则会阻塞当前线程，所以不要主线程 wait
    while (flag == 0) {
        [condition wait];
    }
    flag--;

    NSLog(@"Run Task 2 Start");
    sleep(1);
    NSLog(@"Run Task 2 End");

    flag++;
    [condition signal];
});
