typedef NSString * SDWebImageContextOption NS_EXTENSIBLE_STRING_ENUM;
typedef NSDictionary SDWebImageContext;
typedef NSMutableDictionary SDWebImageMutableContext;

- (void)sd_internalSetImageWithURL:(nullable NSURL *)url
                  placeholderImage:(nullable UIImage *)placeholder
                           options:(SDWebImageOptions)options
                           context:(nullable SDWebImageContext *)context
                     setImageBlock:(nullable SDSetImageBlock)setImageBlock
                          progress:(nullable SDImageLoaderProgressBlock)progressBlock
                         completed:(nullable SDInternalCompletionBlock)completedBlock {

    // 一般情况我们并不会设置context,也就是context默认为nil                    
    context = [context copy]; // copy to avoid mutable object
    NSString *validOperationKey = context[SDWebImageContextSetImageOperationKey];
    if (!validOperationKey) {
        validOperationKey = NSStringFromClass([self class]);
    }
    self.sd_latestOperationKey = validOperationKey;
    [self sd_cancelImageLoadOperationWithKey:validOperationKey];
    self.sd_imageURL = url;        

    // 如果没有设置延迟加载占位图，那就显示占位图                     
    if (!(options & SDWebImageDelayPlaceholder)) {
        dispatch_main_async_safe(^{
            [self sd_setImage:placeholder imageData:nil basedOnClassOrViaCustomSetImageBlock:setImageBlock cacheType:SDImageCacheTypeNone imageURL:url];
        });
    }

    if (url) {
    // 因为可能重新设置图片，所以progress需要重置
    // reset the progress
    NSProgress *imageProgress = objc_getAssociatedObject(self, @selector(sd_imageProgress));
    if (imageProgress) {
        imageProgress.totalUnitCount = 0;
        imageProgress.completedUnitCount = 0;
    }

#if SD_UIKIT || SD_MAC
        // self.sd_imageIndicator 是一个关联对象，默认为空。imageIndicator在加载图片是转圈
    // check and start image indicator
    [self sd_startImageIndicator];
    id imageIndicator = self.sd_imageIndicator;
#endif

        // context一般为nil，所以 manager = [SDWebImageManager sharedManager]
    SDWebImageManager *manager = context[SDWebImageContextCustomManager];
    if (!manager) {
        manager = [SDWebImageManager sharedManager];
    }

    SDImageLoaderProgressBlock combinedProgressBlock = ^(NSInteger receivedSize, NSInteger expectedSize, NSURL * _Nullable targetURL) {
        if (imageProgress) {
            imageProgress.totalUnitCount = expectedSize;
            imageProgress.completedUnitCount = receivedSize;
        }

// 如果有必要，设置进度显示
#if SD_UIKIT || SD_MAC
        if ([imageIndicator respondsToSelector:@selector(updateIndicatorProgress:)]) {
            double progress = 0;
            if (expectedSize != 0) {
                progress = (double)receivedSize / expectedSize;
            }
            progress = MAX(MIN(progress, 1), 0); // 0.0 - 1.0
            dispatch_async(dispatch_get_main_queue(), ^{
                [imageIndicator updateIndicatorProgress:progress];
            });
        }
#endif

        if (progressBlock) {
            progressBlock(receivedSize, expectedSize, targetURL);
        }
    };


    @weakify(self);
    id  operation = [manager loadImageWithURL:url options:options context:context progress:combinedProgressBlock completed:^(UIImage *image, NSData *data, NSError *error, SDImageCacheType cacheType, BOOL finished, NSURL *imageURL) {
        @strongify(self);
        if (!self) { return; }
        // if the progress not been updated, mark it to complete state
        if (imageProgress && finished && !error && imageProgress.totalUnitCount == 0 && imageProgress.completedUnitCount == 0) {
            imageProgress.totalUnitCount = SDWebImageProgressUnitCountUnknown;
            imageProgress.completedUnitCount = SDWebImageProgressUnitCountUnknown;
        }

#if SD_UIKIT || SD_MAC
        // check and stop image indicator
        if (finished) {
            [self sd_stopImageIndicator];
        }
#endif

        BOOL shouldCallCompletedBlock = finished || (options & SDWebImageAvoidAutoSetImage);
        BOOL shouldNotSetImage = ((image && (options & SDWebImageAvoidAutoSetImage)) ||
                                  (!image && !(options & SDWebImageDelayPlaceholder)));
        SDWebImageNoParamsBlock callCompletedBlockClojure = ^{
            if (!self) { return; }
            if (!shouldNotSetImage) {
                [self sd_setNeedsLayout];
            }
            if (completedBlock && shouldCallCompletedBlock) {
                completedBlock(image, data, error, cacheType, finished, url);
            }
        };

        // case 1a: we got an image, but the SDWebImageAvoidAutoSetImage flag is set
        // OR
        // case 1b: we got no image and the SDWebImageDelayPlaceholder is not set
        if (shouldNotSetImage) {
            dispatch_main_async_safe(callCompletedBlockClojure);
            return;
        }

        UIImage *targetImage = nil;
        NSData *targetData = nil;
        if (image) {
            // case 2a: we got an image and the SDWebImageAvoidAutoSetImage is not set
            targetImage = image;
            targetData = data;
        } else if (options & SDWebImageDelayPlaceholder) {
            // case 2b: we got no image and the SDWebImageDelayPlaceholder flag is set
            targetImage = placeholder;
            targetData = nil;
        }

#if SD_UIKIT || SD_MAC
        // check whether we should use the image transition
        SDWebImageTransition *transition = nil;
        if (finished && (options & SDWebImageForceTransition || cacheType == SDImageCacheTypeNone)) {
            transition = self.sd_imageTransition;
        }
#endif
        dispatch_main_async_safe(^{
#if SD_UIKIT || SD_MAC
            [self sd_setImage:targetImage imageData:targetData basedOnClassOrViaCustomSetImageBlock:setImageBlock transition:transition cacheType:cacheType imageURL:imageURL];
#else
            [self sd_setImage:targetImage imageData:targetData basedOnClassOrViaCustomSetImageBlock:setImageBlock cacheType:cacheType imageURL:imageURL];
#endif
            callCompletedBlockClojure();
        });
    }];
    [self sd_setImageLoadOperation:operation forKey:validOperationKey];
} else {
#if SD_UIKIT || SD_MAC
    [self sd_stopImageIndicator];
#endif
    dispatch_main_async_safe(^{
        if (completedBlock) {
            NSError *error = [NSError errorWithDomain:SDWebImageErrorDomain code:SDWebImageErrorInvalidURL userInfo:@{NSLocalizedDescriptionKey : @"Image url is nil"}];
            completedBlock(nil, nil, error, SDImageCacheTypeNone, YES, url);
        }
    });
   }                      
}
