内置函数
转：http://www.cnblogs.com/chengmo/archive/2010/10/08/1845913.html
这节详细介绍awk内置函数，主要分以下3种类似：算数函数、字符串函数、其它一般函数、时间函数
一、算术函数**:**
以下算术函数执行与 C 语言中名称相同的子例程相同的操作：



函数名
说明




atan2( y, x )
返回 y/x 的反正切。


cos( x )
返回 x 的余弦；x 是弧度。


sin( x )
返回 x 的正弦；x 是弧度。


exp( x )
返回 x 幂函数。


log( x )
返回 x 的自然对数。


sqrt( x )
返回 x 平方根。


int( x )
返回 x 的截断至整数的值。


rand( )
返回任意数字 n，其中 0 


srand( [Expr] )
将 rand 函数的种子值设置为 Expr 参数的值，或如果省略 Expr 参数则使用某天的时间。返回先前的种子值。



举例说明：
$ awk 'BEGIN{OFMT="%.3f";fs=sin(1);fe=exp(10);fl=log(10);fi=int(3.1415);print fs,fe,fl,fi;}'
0.841 22026.466 2.303 3
OFMT 设置输出数据格式是保留3位小数
获得随机数：
[chengmo@centos5 ~]$ awk 'BEGIN{srand();fr=int(100*rand());print fr;}'
78
[chengmo@centos5 ~]$ awk 'BEGIN{srand();fr=int(100*rand());print fr;}'
31
[chengmo@centos5 ~]$ awk 'BEGIN{srand();fr=int(100*rand());print fr;}'
41
二、字符串函数是：



函数
说明




gsub( Ere, Repl, [ In ] )
全局替换，除了正则表达式所有具体值被替代这点，它和sub 函数完全一样地执行，。


sub( Ere, Repl, [ In ] )gensub(Ere, Repl, h, [In])
sub:第一次出现的替换，用 Repl 参数指定的字符串替换 In 参数指定的字符串中的由 Ere 参数指定的扩展正则表达式的第一个具体值。sub 函数返回替换的字符数量。出现在 Repl参数指定的字符串中的 &（和符号）由 In 参数指定的与Ere 参数的指定的扩展正则表达式匹配的字符串替换。如果未指定 In 参数，缺省值是整个记录（$0 记录变量）。gensub:类似于sub，但是h参数可以控制替换的位置,g/G全局替换，h为数字表示替换第几次出现的位置，具体查看man awk


index( String1, String2 )
在由 String1 参数指定的字符串（其中有出现 String2 指定的参数）中，返回位置，从 1 开始编号。如果 String2参数不在 String1 参数中出现，则返回 0（零）。


length [(String)]
返回 String 参数指定的字符串的长度（字符形式）。如果未给出 String 参数，则返回整个记录的长度（$0 记录变量）。


blength [(String)]
返回 String 参数指定的字符串的长度（以字节为单位）。如果未给出 String 参数，则返回整个记录的长度（$0 记录变量）。


substr( String, M, [ N ] )
返回具有 N 参数指定的字符数量子串。子串从 String 参数指定的字符串取得，其字符以 M 参数指定的位置开始。M参数指定为将 String 参数中的第一个字符作为编号 1。如果未指定 N 参数，则子串的长度将是 M 参数指定的位置到String 参数的末尾 的长度。


match( String, Ere )可以使用'~'**$0 ~ /partern/**
在 String 参数指定的字符串（Ere 参数指定的扩展正则表达式出现在其中）中返回位置（字符形式），从 1 开始编号，或如果 Ere 参数不出现，则返回 0（零）。RSTART特殊变量设置为返回值。RLENGTH 特殊变量设置为匹配的字符串的长度，或如果未找到任何匹配，则设置为 -1（负一）。


split( String, A, [Ere] )
将 String 参数指定的参数分割为数组元素 A[1], A[2], . . ., A[n]，并返回 n 变量的值。此分隔可以通过 Ere 参数指定的扩展正则表达式进行，或用当前字段分隔符（FS 特殊变量）来进行（如果没有给出 Ere 参数）。除非上下文指明特定的元素还应具有一个数字值，否则 A 数组中的元素用字符串值来创建。


tolower( String)
返回 String 参数指定的字符串，字符串中每个大写字符将更改为小写。大写和小写的映射由当前语言环境的LC_CTYPE 范畴定义。


toupper( String )
返回 String 参数指定的字符串，字符串中每个小写字符将更改为大写。大写和小写的映射由当前语言环境的LC_CTYPE 范畴定义。


sprintf(Format, Expr, Expr, . . . )
根据 Format 参数指定的 printf 子例程格式字符串来格式化 Expr 参数指定的表达式并返回最后生成的字符串。




sub

sub("需要匹配的内容，可以是正则表达式","匹配到的内容替换成什么","目标字符串")

$ echo "  top," | awk -F "," '{sub("^ *","");print $1}' 
top
$ echo "  top," | awk -F "," '{sub("^ *","",$1);print $1}'
top
$ echo "  top," | awk -F "," '{sub("^ *","lalal",$1);print $1}'
lalaltop
